// SPDX-License-Identifier: AGPL-3.0-or-later

pragma solidity =0.6.12;

interface IBMoonCats {
    function catOwners(bytes5 catId) external view returns (address);

    function rescueOrder(uint256 index) external view returns (bytes5);
}

contract BMoonCatsReader {
    constructor() public {}

    IBMoonCats private constant bMoonCats = IBMoonCats(0x7A00B19eDc00fa5fB65F32B4D263CE753Df8f651);

    function getCatOwners(uint256 from, uint256 size) external view returns (address[] memory) {
        if (from < 25600 && size > 0) {
            uint256 querySize = size;
            if ((from + size) > 25600) {
                querySize = 25600 - from;
            }
            address[] memory owners = new address[](25600);
            for (uint256 i = 0; i < querySize; i++) {
                owners[i] = bMoonCats.catOwners(bMoonCats.rescueOrder(i + from));
            }
            return owners;
        }
    }
}
